const AddStudent = ({ token }) => {
  const [assignedClass, setAssignedClass] = useState(null);
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    date_of_birth: '',
    gender: 'M',   // default gender
    address: '',
    parent_contact: ''
  });

  useEffect(() => {
    if (!token) return;

    axios.get('http://localhost:8000/api/assignedclass/', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => setAssignedClass(res.data))
      .catch(err => {
        console.error('Failed to fetch assigned class:', err);
        alert('Error fetching assigned class. Please login again.');
      });
  }, [token]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!assignedClass) return alert("Loading class info, please wait.");

    try {
      await axios.post('http://localhost:8000/api/AddStudent/', {
        ...formData,
        student_class: assignedClass.id
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      alert('Student profile created successfully!');
      setFormData({
        username: '',
        email: '',
        password: '',
        date_of_birth: '',
        gender: 'M',
        address: '',
        parent_contact: ''
      });
    } catch (error) {
      alert('Failed to create student: ' + JSON.stringify(error.response?.data || error.message));
    }
  };

  if (!assignedClass) return <p>Loading assigned class...</p>;

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Username:</label>
        <input
          name="username"
          value={formData.username}
          onChange={handleChange}
          required
          minLength={3}
        />
      </div>
      <div>
        <label>Email:</label>
        <input
          name="email"
          type="email"
          value={formData.email}
          onChange={handleChange}
          required
        />
      </div>
      <div>
        <label>Password:</label>
        <input
          name="password"
          type="password"
          value={formData.password}
          onChange={handleChange}
          required
          minLength={6}
        />
      </div>
      <div>
        <label>Date of Birth:</label>
        <input
          name="date_of_birth"
          type="date"
          value={formData.date_of_birth}
          onChange={handleChange}
          required
        />
      </div>
      <div>
        <label>Gender:</label>
        <select
          name="gender"
          value={formData.gender}
          onChange={handleChange}
        >
          <option value="M">Male</option>
          <option value="F">Female</option>
          <option value="O">Other</option>
        </select>
      </div>
      <div>
        <label>Address:</label>
        <textarea
          name="address"
          value={formData.address}
          onChange={handleChange}
          required
        />
      </div>
      <div>
        <label>Parent Contact:</label>
        <input
          name="parent_contact"
          value={formData.parent_contact}
          onChange={handleChange}
          required
        />
      </div>
      <div>
        <label>Class:</label>
        <input value={assignedClass.name} disabled />
      </div>
      <button type="submit">Add Student</button>
    </form>
  );
};

export default AddStudent;
